export default class ChannelGrid extends React.Component {
  render() {
    const { channels } = this.props

    return (
      <div>
        <h2>English</h2>
        <div className="channels">
          {channels.map((channel) => (
            <div key={channel.id}>
              <Link href={`/channel?id=${channel.id}`}>
                <a className="channel">
                  <img
                    src={channel.urls.logo_image.original}
                    alt="channel logo"
                  />
                </a>
              </Link>
              <h2>{channel.title}</h2>
            </div>
          ))}
        </div>
      </div>
    )
  }
}
